import React from "react";
import styled from "styled-components";

const AboutEC_Page = styled.div`
  height: 1299px;
  background-color: #f2f2f2;
`;

const AboutEcContainer = styled.div`
  max-width: 1280px;
  margin: 0 auto;
  padding-left: 40px;
  padding-right: 40px;
  box-sizing: border-box;
  display: flex;
  flex-direction: column;
  .AboutEcLeft {
    height: 197px;
    box-sizing: border-box;
    font-size: 32px;
    font-weight: bold;
    padding-top: 100px;
  }
  .AboutEcContent {
    max-width: 848px;
    box-sizing: border-box;
    margin-left: 20%;
  }
  .AboutEcContent span {
    font-size: 36px;
    font-weight: bold;
    font-family: Kanit;
  }
`;

function AboutEC() {
  return (
    <AboutEC_Page>
      <AboutEcContainer>
        <div className="AboutEcLeft">
          <span>AboutEC</span>
        </div>
        <div className="AboutEcContent">
          <div>
            <span>Endless Creation</span> 은 사람과 컴퓨터를 사랑하는 동아리로,
            <br /> 개발하는 재미와 성장하는 즐거움을 알아갈 수 있는 다양한
            활동을 준비하고 있습니다.
          </div>
          <div className="AboutEcVideo"></div>
          <div className="AboutEcnamehardtq">
            <div>1</div>
            <div>2</div>
            <div>3</div>
          </div>
        </div>
      </AboutEcContainer>
    </AboutEC_Page>
  );
}

export default AboutEC;
